import React from 'react';
import CustomerPayment from '../form/form'
import PaymentDetails from '../form/payment_details'

class TransactionContent extends React.Component{
  render(){
    return(
      <div>
      <CustomerPayment json={PaymentDetails}/>
      </div>
    )
  }
}

export default TransactionContent
